import { useStorage } from '@capacitor-community/react-hooks/storage';
import { verify } from 'crypto';

let counter = 0

export function useToDoList() {

    let item = {
        id: 1,
        text: 'un exemple',
        checked: false
    }


    let listItems = useS[item];

    function addItem(text) {
        const newItem = {
            id: counter++,
            text: text,
            checked: false
        }
        listItems.push(newItem)
    }


    return {
        listItems, addItem
    }

}
